import React from 'react';

function Header(props) {
  return (
    <header>
      <h1>{props.title}</h1>
      <nav>
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">About</a></li>
          <li><a href="#">Shop</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
        <button>Sign In</button>

      </nav>
    </header>
  );
}

export default Header;
